u4=H("<p>A common use case for this filter is to include or exclude only traffic mentioning a subdirectory, e.g. 'mysubdirectory'. To create this filter, simply enter this into the 'Filter Pattern' field: /mysubdirectory/</p><p>Below are some more examples for this filter type:</p><ul><li>^/mysubdirectory: Include only traffic to a specific top level directory</li><li>/es/ or ^/es/: Include only the bottom-level directory (e.g. you only want to look at Spanish pages on the site example.com/topleveldirectory/es/newsletters.html)</li></ul>"),
